import React from 'react';
import './footer.css';

export default function Footer() {
  return (
    <div className="foote">
      <figure>
        <img src="../../assets/logo.svg" alt="Logo-FJS" />
      </figure>
      <p>&copy; Todos os direitos reservados: Acelera FJS</p>
    </div>
  );
}
